import React, { Component } from 'react'

export default class Message extends Component {
    state ={
        message:[{
            id:'01',
            title:'message1',
            content:' react params传参'
        },{
            id:'02',
            title:'message2',
            content:' react seach传参'
        },{
            id:'03',
            title:'message1',
            content:' react params传参'
        }]
    }
  render() {
    const {message} =this.state
    return (
      <ul>
        {
            message.map((obj)=>{
                return(
                    <li key={obj.id}>{obj.title}</li>
                )
            })
        }
        <li>Message1</li>
        <li>Message2</li>
        <li>Message3</li>
      </ul>
    )
  }
}
